package ui;

import java.util.*;

public class Inlezen_Uitschrijven_Array
{
    public static void main(String args[])
    {
        String result;
        int getallen[] = new int[5];
		inlezenArray(getallen);

        result = "De ingegeven getallen zijn : \n";
	
		result += uitschrijvenArray(getallen);

        System.out.printf(result);
    }

    private static void inlezenArray(int[] getn) {
		Scanner input = new Scanner(System.in);
		for (int index = 0; index < getn.length; index++) {
            System.out.printf("Geef getal %d :", index + 1);
            getn[index] = input.nextInt();
        }
    }

    private static String uitschrijvenArray(int[] getn) {
		String res = "";
		int index = 1;
		for (int getal:getn)  //int[] getn {
            res += String.format("Getal %d = %d\n", index++, getal);
        }
		return res;
    }
}
